import React, { useEffect, useState } from 'react';
import ShowCommunityImages from '../ShowCommunityImages/ShowCommunityImages';

const GetCommunityImages = () => {
    const [images, setEvents] = useState([]);
    const [search, setSearch] = useState('')

    useEffect(() => {
        fetch(`http://localhost:3002/communityImages`)
            .then(res => res.json())
            .then(data => setEvents(data))
    }, [])

    console.log("dawd", images);
    return (
        <section className="services-container">
            {/* <Navbar></Navbar> */}
            <div className="text-center">
                <div class="form-group row d-flex justify-content-center">
                    {/* <label for="inputEmail4">FirstName</label> */}
                    <input type="" class="form-control border border-danger col-md-5" placeholder="Type Here" onChange={e => { setSearch(e.target.value) }} />


                    {/* <input type="" class="form-control  col-md-6" id="inputEmail4" /> */}
                    <button type="submit" class="btn btn-danger form-control  col-md-1 ml-2"> Search </button>
                </div>
            </div>
            <div className="d-flex justify-content-center align-items-center">
                <div className="w-100 row pb-5  justify-content-center">
                    {
                        images.filter((val) => {
                            if (search == "") {
                                return val
                            } else if (val.title.toLowerCase().includes(search.toLocaleLowerCase()))
                                return val
                        }).map(image => <ShowCommunityImages image={image}></ShowCommunityImages>)
                    }
                </div>
            </div>
        </section>
    );
};

export default GetCommunityImages;
